import React, {useState} from 'react';
import About from './Components/About';
import Nav from './Components/Nav';
import Portfolio from './Components/Portfolio';
import './App.css';

function App() {
  const components = [<About/>, <Portfolio/>]
  const[current, setCurrent]= useState(components[0]);
  return (
    <div>
      <header>
        <Nav setCurrent={setCurrent} ></Nav>
      </header>
      <main>
        <button onClick ={()=>setCurrent(components[1])}>Button</button>
     {current}
      </main>

    </div>
  );
}

export default App;
